import React from "react";

const Navbar = () => {
  return (
    <div>
      <ul>
        <li>Homepage</li>
        <li>Add product</li>
        <li>Update Product</li>
        <li>Logout</li>
        <li>Profile</li>
        <li></li>
      </ul>
    </div>
  );
};

export default Navbar;
